const backendDomain = "http://localhost:8080";


const SummeryApi = {
    signUp : {
        url : `${backendDomain}/api/signup`,
        method : "post",
    },
    signIn : {
        url : `${backendDomain}/api/signin`,
        method : "post",
    },
    current_user : {
        url : `${backendDomain}/api/user-details`,
        method : "get",
    },
    logout_user : {
        url : `${backendDomain}/apiuserLogout`,
        method : "get",
    }

}

export default SummeryApi;
